import React from "react";
import { Link } from "react-router-dom";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <Link><a className="navbar-brand" href="/">Search</a></Link>
      <Link><a className="navbar-brand" href="/saved">Saved</a></Link>

    </nav>
  );
}

export default Nav;
